  /**
   * List of bitmaps representing matches to leaf query terms within each of the highlighted snippet
   * text fragments. Consecutive bitmaps correspond to consecutive text fragments. It gets populated
   * iff return_query_snippet_highlight_matches = true. Example: document body section: "This cafe
   * has pet friendly patio." squery: (a (o dog :o pet :syn:general) friendly :o (o restaurant :o
   * cafe :syn:general)) Let's assume the returned snippet text contains the whole document body
   * section where two fragments get highlighted as follows: "This *cafe* has *pet friendly* patio."
   * Then, the returned snippet_highlight_matches_bitmap[] list will have two bitmaps: bitmap[0] =
   * <"cafe" -> leaf term with index 4> = {encoded: DenseEncode("00001"), size: 5} bitmap[1] =
   * <"pet" and "friendly" -> leaf terms with indexes 1 and 2> = {encoded: DenseEncode("011"), size:
   * 3}
   * @return value or {@code null} for none
   */
